        public static void AddpostalSubdisrict(List<PostalSubdisrict> data , RicnessDbContext  context)
        {
            int lenght = data.Count;
            for (int i = 0; i < lenght; i = i + 400)
            {
                PostalSubdisrict[] aPostalSubdisrict = data.Skip(i).Take(400).ToArray();
                if (aPostalSubdisrict is not null && aPostalSubdisrict.Length > 0)
                {
                    context.AddRange(aPostalSubdisrict);
                    context.SaveChanges();
                }
            }
        }
